import React from 'react';
import { createMuiTheme, formatMs, ThemeProvider } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import './App.scss';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

const theme = createMuiTheme({
    palette: {
    //type:'dark'
    },

  });

const Nav = () =>(
    <ThemeProvider theme={theme}>
    <Router> 
    <nav>
    <ul>
    <Link to='/Footer'><li>Home</li></Link> 

    <li>Products</li>
    <li>Prices</li>
    <li>Contact</li>    
    </ul>
    </nav>

    sw
  </Router>
    </ThemeProvider>


    )
    export default Nav;
